    return (
        <footer>
            <div>
                <p>Desenvolvido por</p>
                <p className="github-link"><a href="https://github.com/alessandro-chrystian" target="_blank">Alessandro Chrystian</a></p>
            </div>
        </footer>
    )
}

export default Footer;
